import React from 'react'
import '../styles/style.css'

function Snake(props) {
    
    const snakeDot = props.snakeDot.map((item,i)=>{
        
        const style = {
            left: `${item[0]}%`,
            top: `${item[1]}%`
        }    

        return(
            <div className='snake' style={style} ></div>
        )
    })
  
    return (
        {snakeDot}
  )
}

export default Snake
